#include <stdio.h>
#include <string.h>

int get_int(char *in)
{
    int i = 0;
    int j = 0;
    while (in[i] != '\0')
    {
        if (in[i] != ' ')
        {
            i++;
        }
        else
        {
            return i;
        }
    }
    return -1;
}

int main(void)
{
    char arr[] = "123";
    int i = get_int(arr);
    printf("%d", i);
    return 0;
}

A:

The arguments in your function are not pointers to the string.
It is just a char array.
So you need to pass the address of the array in the function.
But since you are passing a pointer to an array as the argument, you cannot use that pointer to access the elements of the array in your function.
So you need to copy the contents of the array to a new array and pass the address of that new array as the argument.

