How to access a property of an instance of a Dictionary?

I have a Dictionary where I'm storing some data of type A. I want to access the property of an instance of type B
var dict = new Dictionary<int, A>();

I want to be able to access the property of type B from the instance of type A. Is there a way to do this?

A:

You can cast the key to type B, and then access the property of type B of the instance of A that the key is mapped to.
var dict = new Dictionary<int, A>();
var b = (B)dict[1];
b.property = "the value";

A:

You can use reflection to do this.  The code below prints "2" to the console:

class A {
    public int Value { get; set; }
}

class B {
    public string Property { get; set; }
}

class Program
{
    static void Main(string[] args)
    {
        var dict = new Dictionary<int, A>();
        var a = dict[1] as A;
        var b = (B)dict[1];
        b.Property = "Whiskers";
        Console.WriteLine(a.Value);
        Console.WriteLine(b.Property);
    }
}

