What is the difference between non-numeric and numeric variables in R?

I'm a beginner in R and I have a question, what's the difference between non-numeric and numeric variables in R?

A:

Non-numeric variables are character or logical variables. In this case, non-numeric variables include:

the names of R objects
the result of a function

Numeric variables are all the other things. They include:

numeric values
matrices
vectors
lists
complex numbers
functions
data frames
...

Note that all variables are objects in R, so they can be names.

