I have a simple array of integers, and I need to sort it by the second number, which is always in the middle of the array). I have been able to sort it with a bubble sort, but I would like to sort it with a quick sort if I can, because it would be faster. Is there a method in C to sort an array of integers by the second value in the array?

A:

If you want to sort an array by the second element, you could do
sort(array, n+1, array + n, cmp_func);

where n is the total number of elements and cmp_func is a comparison function that returns an integer, zero if the first element is equal to the second, otherwise negative if the first element is less than the second.
If you want to sort the array by the middle element, you could do
sort(array, n/2, array + n, cmp_func);

where n is the total number of elements and cmp_func is a comparison function that returns an integer, zero if the first element is equal to the second, otherwise negative if the first element is less than the second.
If you want to sort the array by the third element, you could do
sort(array, n/3, array + n/3, cmp_func);

where n is the total number of elements and cmp_func is a comparison function that returns an integer, zero if the first element is equal to the second, otherwise negative if the first element is less than the second.
Further, if you want to order the array by the nth element (where n is the total number of elements), you could do
sort(array, 0, n-1, cmp_func);

