I’m from Chile and I have a question. What is the most popular wine varietal produced in Chile?

A:

It's likely to be Chilean wine.  According to the Argentine Wine Institute, in 2014 Chilean wines made up 59.5% of the wine production in Chile.  This isn't a great number, but it's still significant.  It looks like the most popular wine going into Chile's export market is Chardonnay.  

